"""Mempersiapkan format data yang akan dimasukkan ke dalam pemodelan LSTM.

Membagi data menjadi urutan-urutan (sequences) berdasarkan panjang yang ditentukan, di mana setiap urutan berisi data selama sequence_length langkah waktu, dan nilai targetnya adalah data yang muncul setelah urutan tersebut. Dalam latihan ini, sequence yang digunakan adalah 1 dengan dasar data yag digunakan dalam pelatihan ini adalah data harian.
"""

def create_dataset(data, sequence_length):
    X, y = [], []
    for i in range(len(data) - sequence_length):
        X.append(data[i:i+sequence_length])
        y.append(data[i+sequence_length])
    return np.array(X), np.array(y)

