"""# Modeling

## LSTM

Langkah modeling dimulai dengan mendefinisikan fungsi untuk menyusun, melatih, dan mengevaluasi model LSTM dengan berbagai kombinasi hyperparameter, lalu memilih model terbaik berdasarkan nilai Mean Squared Error (MSE).
"""

from keras.models import Sequential
from keras.layers import LSTM, Dense, Dropout
from keras.optimizers import Adam
from sklearn.metrics import mean_squared_error
import numpy as np

# Fungsi Model LSTM
def create_lstm_model(X_train, y_train, X_test, y_test, scaler, units, dropout, batch_size, epochs):
    model = Sequential()
    model.add(LSTM(units=units, input_shape=(X_train.shape[1], X_train.shape[2])))
    if dropout > 0:
        model.add(Dropout(dropout))
    model.add(Dense(2))
    model.compile(optimizer=Adam(learning_rate=0.01), loss='mean_squared_error')

    # Training
    history = model.fit(X_train, y_train, epochs=epochs, batch_size=batch_size, verbose=0, validation_data=(X_test, y_test))

    # Evaluasi model
    predictions = model.predict(X_test)
    predictions_rescaled = scaler.inverse_transform(predictions)
    y_test_rescaled = scaler.inverse_transform(y_test)
    mse = mean_squared_error(y_test_rescaled, predictions_rescaled)

    return mse, model, history.history

# Hyperparameter tuning
units_list = [50, 100, 150]
dropout_list = [0.01]
batch_size_list = [16, 32, 64]
epochs = 100

best_mse = float('inf')
best_params = {}
best_model = None
history_results = []

for units in units_list:
    for dropout in dropout_list:
        for batch_size in batch_size_list:
            print(f"Training with units={units}, dropout={dropout}, batch_size={batch_size}")
            mse, model, history = create_lstm_model(X_train, y_train, X_test, y_test, scaler,
                                                    units=units, dropout=dropout,
                                                    batch_size=batch_size, epochs=epochs)
            print(f"Model MSE: {mse}")

            # Simpan hasil history
            history_results.append({
                "params": {"units": units, "dropout": dropout, "batch_size": batch_size},
                "history": history,
                "mse": mse
            })

            # Simpan model terbaik
            if mse < best_mse:
                best_mse = mse
                best_params = {"units": units, "dropout": dropout, "batch_size": batch_size}
                best_model = model

# Hasil terbaik
