from sklearn.metrics import mean_squared_error, mean_absolute_error, r2_score
import math

def train_lstm(X_train, y_train, X_test, y_test, scaler, epochs=50, units=50, dropout=0.0, batch_size=32):

    # Modeling
    model = Sequential()
    model.add(LSTM(units=units, input_shape=(X_train.shape[1], X_train.shape[2])))
    if dropout > 0:
        model.add(Dropout(dropout))
    model.add(Dense(2))
    model.compile(optimizer='adam', loss='mean_squared_error')

    # Training Model
    history = model.fit(X_train, y_train, epochs=epochs, batch_size=batch_size,
                        validation_data=(X_test, y_test), verbose=1)

    # Prediksi
    predictions = model.predict(X_test)

    # Rescale Predictions
    predictions_rescaled = scaler.inverse_transform(predictions)
    y_test_rescaled = scaler.inverse_transform(y_test)

    # Evaluasi Model untuk setiap fitur
    results = {}
    for i, feature in enumerate(["ff_x", "ddd_deg"]):
        mse = mean_squared_error(y_test_rescaled[:, i], predictions_rescaled[:, i])
        rmse = math.sqrt(mse)
        mae = mean_absolute_error(y_test_rescaled[:, i], predictions_rescaled[:, i])
        r2 = r2_score(y_test_rescaled[:, i], predictions_rescaled[:, i])

        results[feature] = {
            "MSE": mse,
            "RMSE": rmse,
            "MAE": mae,
            "R2": r2
        }

        # Print Evaluasi
        print(f"{feature} - Mean Squared Error (MSE): {mse}")
        print(f"{feature} - Root Mean Squared Error (RMSE): {rmse}")
        print(f"{feature} - Mean Absolute Error (MAE): {mae}")
        print(f"{feature} - R-squared (R²): {r2}")
        print("-" * 40)

    return model, history, results

from keras.layers import Bidirectional

def train_bilstm(X_train, y_train, X_test, y_test, scaler, epochs=50, units=50, dropout=0.0, batch_size=32, feature_names=["ff_x", "ddd_deg"]):
    model = Sequential()
    model.add(Bidirectional(LSTM(units=units, input_shape=(X_train.shape[1], X_train.shape[2]))))
    if dropout > 0:
        model.add(Dropout(dropout))
    model.add(Dense(2))
    model.compile(optimizer='adam', loss='mean_squared_error')

    # Training Model
    history = model.fit(X_train, y_train, epochs=epochs, batch_size=batch_size,
                        validation_data=(X_test, y_test), verbose=1)

    # Predict
    predictions = model.predict(X_test)

    # Rescale Predictions
    predictions_rescaled = scaler.inverse_transform(predictions)
    y_test_rescaled = scaler.inverse_transform(y_test)

    # Evaluate Model for Each Feature
    results = {}
    for i, feature in enumerate(feature_names):
        mse = mean_squared_error(y_test_rescaled[:, i], predictions_rescaled[:, i])
        rmse = math.sqrt(mse)
        mae = mean_absolute_error(y_test_rescaled[:, i], predictions_rescaled[:, i])
        r2 = r2_score(y_test_rescaled[:, i], predictions_rescaled[:, i])

        results[feature] = {
            "MSE": mse,
            "RMSE": rmse,
            "MAE": mae,
            "R2": r2
        }

        # Print Evaluation
        print(f"{feature} - Mean Squared Error (MSE): {mse}")
        print(f"{feature} - Root Mean Squared Error (RMSE): {rmse}")
        print(f"{feature} - Mean Absolute Error (MAE): {mae}")
        print(f"{feature} - R-squared (R²): {r2}")
        print("-" * 40)

    # Visualize Predictions vs Actual
    plot_predictions(y_test_rescaled, predictions_rescaled, feature_names)

    return model, history, results

