from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import LSTM, Dense, Bidirectional
from sklearn.metrics import mean_squared_error, mean_absolute_error, r2_score
import math
import matplotlib.pyplot as plt

# Fungsi untuk membuat model LSTM
def build_lstm(input_shape):
    model = Sequential()
    model.add(LSTM(units=50, input_shape=input_shape))
    model.add(Dense(1))
    model.compile(optimizer='adam', loss='mean_squared_error')
    return model

# Fungsi untuk membuat model Bi-LSTM
def build_bilstm(input_shape):
    model = Sequential()
    model.add(Bidirectional(LSTM(units=50, input_shape=input_shape)))
    model.add(Dense(1))
    model.compile(optimizer='adam', loss='mean_squared_error')
    return model

# Fungsi untuk melatih dan mengevaluasi model
def train_and_evaluate(model, X_train, y_train, X_test, y_test):
    history = model.fit(X_train, y_train, epochs=50, batch_size=32, validation_data=(X_test, y_test), verbose=0)
    predictions = model.predict(X_test)

    # Rescale predictions
    predictions_rescaled = scaler.inverse_transform(predictions)
    y_test_rescaled = scaler.inverse_transform(y_test.reshape(-1, 1))

    # Evaluasi metrik
    mse = mean_squared_error(y_test_rescaled, predictions_rescaled)
    rmse = math.sqrt(mse)
    mae = mean_absolute_error(y_test_rescaled, predictions_rescaled)
    r2 = r2_score(y_test_rescaled, predictions_rescaled)

    return mse, rmse, mae, r2, history

# Input shape untuk kedua model
input_shape = (X_train.shape[1], X_train.shape[2])

# Bangun model LSTM dan Bi-LSTM
lstm_model = build_lstm(input_shape)
bilstm_model = build_bilstm(input_shape)

# Latih dan evaluasi LSTM
mse_lstm, rmse_lstm, mae_lstm, r2_lstm, history_lstm = train_and_evaluate(lstm_model, X_train, y_train, X_test, y_test)

# Latih dan evaluasi Bi-LSTM
mse_bilstm, rmse_bilstm, mae_bilstm, r2_bilstm, history_bilstm = train_and_evaluate(bilstm_model, X_train, y_train, X_test, y_test)

# Perbandingan Hasil
print("LSTM:")
print(f"MSE: {mse_lstm}, RMSE: {rmse_lstm}, MAE: {mae_lstm}, R²: {r2_lstm}")

print("Bi-LSTM:")
print(f"MSE: {mse_bilstm}, RMSE: {rmse_bilstm}, MAE: {mae_bilstm}, R²: {r2_bilstm}")

# Visualisasi Loss selama pelatihan
plt.figure(figsize=(12, 6))
plt.plot(history_lstm.history['loss'], label='LSTM Train Loss')
plt.plot(history_lstm.history['val_loss'], label='LSTM Validation Loss')
