import numpy as np
from sklearn.metrics import mean_squared_error
import matplotlib.pyplot as plt

# Fungsi untuk membuat dataset dengan sequence tertentu
def create_dataset(data, sequence_length):
    X, y = [], []
    for i in range(len(data) - sequence_length):
        X.append(data[i:i+sequence_length])
        y.append(data[i+sequence_length])
    return np.array(X), np.array(y)

# Fungsi untuk pelatihan dan evaluasi LSTM
def train_and_evaluate_lstm(X_train, y_train, X_test, y_test):
    model = Sequential()
    model.add(LSTM(units=50, input_shape=(X_train.shape[1], X_train.shape[2])))
    model.add(Dense(1))
    model.compile(optimizer='adam', loss='mean_squared_error')
    model.fit(X_train, y_train, epochs=50, batch_size=32, verbose=0)
    predictions = model.predict(X_test)
    mse = mean_squared_error(y_test, predictions)
    return mse

# Misalnya, data sudah disiapkan
data = df_filled['ff_x'].values
data = data.reshape(-1, 1)  # pastikan data dalam bentuk (n_samples, n_features)

# Normalisasi data
scaler = MinMaxScaler(feature_range=(0, 1))
data_scaled = scaler.fit_transform(data)

# Split data menjadi training dan test
train_size = int(len(data_scaled) * 0.8)
train, test = data_scaled[:train_size], data_scaled[train_size:]

# Menyimpan hasil MSE untuk setiap panjang sequence
sequence_lengths = [1, 5, 10, 20, 50, 100]
mse_results = []

# Evaluasi untuk berbagai panjang sequence
for sequence_length in sequence_lengths:
    X_train, y_train = create_dataset(train, sequence_length)
    X_test, y_test = create_dataset(test, sequence_length)

    # reshape data untuk LSTM [samples, timesteps, features]
    X_train = X_train.reshape(X_train.shape[0], X_train.shape[1], 1)
    X_test = X_test.reshape(X_test.shape[0], X_test.shape[1], 1)

    # Pelatihan dan evaluasi LSTM
    mse = train_and_evaluate_lstm(X_train, y_train, X_test, y_test)
    mse_results.append(mse)

# Visualisasi hasil perbandingan MSE untuk panjang sequence yang berbeda
plt.plot(sequence_lengths, mse_results, marker='o')
plt.title('Perbandingan MSE untuk berbagai panjang Sequence')
plt.xlabel('Panjang Sequence')
plt.ylabel('Mean Squared Error (MSE)')
plt.show()

# Menampilkan panjang sequence terbaik
best_sequence_length = sequence_lengths[np.argmin(mse_results)]
print(f"Panjang sequence optimal berdasarkan MSE: {best_sequence_length}")

# modeling
model = Sequential()
model.add(LSTM(units=50, input_shape=(X_train.shape[1], X_train.shape[2])))
model.add(Dense(1))  # output layer untuk prediksi satu nilai

# compile Model
model.compile(optimizer='adam', loss='mean_squared_error')

# training model
history = model.fit(X_train, y_train, epochs=50, batch_size=32, validation_data=(X_test, y_test), verbose=1)

# prediksi
predictions = model.predict(X_test)

# rescale
predictions_rescaled = scaler.inverse_transform(predictions)
y_test_rescaled = scaler.inverse_transform(y_test.reshape(-1, 1))

# evaluasi model
from sklearn.metrics import mean_squared_error, mean_absolute_error, r2_score
import math

