from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import LSTM, Dense, Dropout, Bidirectional
from sklearn.preprocessing import MinMaxScaler
from sklearn.model_selection import train_test_split
import numpy as np
from sklearn.metrics import mean_squared_error, mean_absolute_error, r2_score
import math

# Normalisasi data
scaler = MinMaxScaler(feature_range=(0, 1))
data_scaled = scaler.fit_transform(df_filled[['ff_x']])

# Membagi data menjadi training dan test set
train_data, test_data = train_test_split(data_scaled, test_size=0.2, shuffle=False)

# Membuat dataset dengan sliding window
def create_dataset(data, sequence_length):
    X, y = [], []
    for i in range(len(data) - sequence_length):
        X.append(data[i:i+sequence_length, 0])  # Ambil nilai fitur pertama (misalnya ff_x)
        y.append(data[i+sequence_length, 0])  # Ambil target
    return np.array(X), np.array(y)

sequence_length = 30  # Misalnya 30 hari sebelumnya untuk prediksi

X_train, y_train = create_dataset(train_data, sequence_length)
X_test, y_test = create_dataset(test_data, sequence_length)

# Reshaping data untuk input ke LSTM [samples, timesteps, features]
X_train = X_train.reshape(X_train.shape[0], X_train.shape[1], 1)
X_test = X_test.reshape(X_test.shape[0], X_test.shape[1], 1)

# Membangun model LSTM dengan optimasi
model = Sequential()

# Menambahkan Bidirectional LSTM
model.add(Bidirectional(LSTM(units=100, return_sequences=True, dropout=0.2), input_shape=(X_train.shape[1], X_train.shape[2])))
model.add(LSTM(units=50, return_sequences=False, dropout=0.2))  # LSTM kedua
model.add(Dense(units=1))  # Output layer

# Kompilasi model
model.compile(optimizer='adam', loss='mean_squared_error')

# Melatih model
history = model.fit(X_train, y_train, epochs=50, batch_size=64, validation_data=(X_test, y_test), verbose=1)

# Evaluasi model
predictions = model.predict(X_test)
predictions_rescaled = scaler.inverse_transform(predictions)

# Mengembalikan normalisasi untuk mendapatkan data asli
y_test_rescaled = scaler.inverse_transform(y_test.reshape(-1, 1))

# Menghitung metrik evaluasi
mse = mean_squared_error(y_test_rescaled, predictions_rescaled)
rmse = math.sqrt(mse)
mae = mean_absolute_error(y_test_rescaled, predictions_rescaled)
r2 = r2_score(y_test_rescaled, predictions_rescaled)

# Menampilkan hasil metrik
print(f"Mean Squared Error (MSE): {mse}")
print(f"Root Mean Squared Error (RMSE): {rmse}")
print(f"Mean Absolute Error (MAE): {mae}")
print(f"R-squared (R²): {r2}")

